    <Title 
    title="Bienvenido a Onda Cero Podcast Manual"
    subtitle="Aquí encontrarás todo lo que necesitas saber sobre nuestro rediseño."
    />
    <p class="font-medium w-8/12">
      En este manual encontrarás todo lo que necesitas saber sobre el rediseño de la marca. 
      Comencemos por nuestros principales cambios.
    </p>
    <div class="inicio my-4 p-8 bg-gray-200 w-full">
      <h3 class="my-4 font-bold text-lg py-2 px-4 w-60 rounded-md bg-green-400 text-white">VARIABILIDAD</h3>
      <p class=" w-8/12">Nuestra idea del mundo se centra en el movimiento, la cambiante y lo variable, por ello hemos querido representar en la   marca este concepto. Nuestra radio esta al día y siempre dispuesta al cambio. 
      </p>
