    <div class="inicio my-4 p-8">
      <h3 class="my-4 font-bold text-lg py-2 px-4 w-60 rounded-md bg-green-400 text-white">ADAPTADOS A LA VIDA</h3>
      <p class=" w-8/12">Queremos adaptarnos a la vida, es decir, seguir el ritmo y los modos de hacer de las personas. Por ello, nuestra app ha   sido creada para que su versión móvil funcione de maravilla. Sabiendo que es el medio más usado para la escucha de este tipo   de contenidos.
      </p>
    </div>
    <div class="inicio my-4 p-8 bg-gray-200 w-full">
      <h3 class="my-4 font-bold text-lg py-2 px-4 w-60 rounded-md bg-green-400 text-white">RENOVAMOS EL COLOR</h3>
      <p class=" w-8/12">Sabemos que tenemos que estar añl día. por eso, hemos seleccionado una nueva gama de colores que no solo ayude al usuario,   sino que consiga hacerle disfrutar.
      </p>
