    <div class="inicio my-4 p-8">
      <h3 class="my-4 font-bold text-lg py-2 px-4 w-60 rounded-md bg-green-400 text-white">DARK MODE</h3>
      <p class=" w-8/12">Los podcast son por lo general algo que se utiliza para divertirse, entretenerse o aprender cuando estas realizando otro   tipo de tareas o quieres desconectar. por ello, contando con el poco uso visual de la plataforma hemos optado por poner como   principal el modo noche. Ahorrando así en batería y en pérdida de visión ;).
      A pesar de ello, hemos incluido la opción de cambiar a modo día si es de tu preferencia.
      </p>
    </div>
    <div class="inicio my-4 p-8 bg-gray-200 w-full">
      <h3 class="my-4 font-bold text-lg py-2 px-4 w-80 rounded-md bg-green-400 text-white">SIMPLIFICAMOS TU DÍA A DÍA</h3>
      <p class=" w-8/12">Hemos creado un nuevo sistema más intuitivo y sencillo, que ayude al usuario a navegar de forma cómoda y sencilla.
      </p>
